"use client"

import { useState } from "react"
import { Link, useNavigate } from "react-router-dom"
import { useAuth } from "../context/AuthContext"

const RegisterPage = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    firstName: "",
    lastName: "",
    phone: "",
  })
  const [loading, setLoading] = useState(false)
  const [error, setError] = useState(null)
  const { register } = useAuth()
  const navigate = useNavigate()

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    })
  }

  const handleSubmit = async (e) => {
    e.preventDefault()
    setLoading(true)
    setError(null)

    try {
      await register(formData)
      navigate("/")
    } catch (err) {
      setError(err.response?.data || "Registration failed")
    } finally {
      setLoading(false)
    }
  }

  return (
   <div className="container py-12">
  <div className="max-w-sm mx-auto"> {/* smaller width */}
    <div className="text-center mb-8">
      <h1 className="text-3xl font-bold mb-2">Create your account</h1>
      <p className="text-muted">Join Event Connect and start booking amazing events</p>
    </div>

    <div className="card p-6"> {/* added padding */}
      {error && (
        <div className="mb-4 p-4 bg-destructive/10 border border-destructive/20 rounded text-destructive">
          {error}
        </div>
      )}

      <form onSubmit={handleSubmit}>
        <div className="grid grid-cols-2 gap-4 mb-4">
          <div>
            <label className="block text-sm font-medium mb-2">First Name</label>
            <input
              type="text"
              name="firstName"
              value={formData.firstName}
              onChange={handleChange}
              className="input"
              required
            />
          </div>
          <div>
            <label className="block text-sm font-medium mb-2">Last Name</label>
            <input
              type="text"
              name="lastName"
              value={formData.lastName}
              onChange={handleChange}
              className="input"
              required
            />
          </div>
        </div>

        <div className="mb-4">
          <label className="block text-sm font-medium mb-2">Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            className="input"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-medium mb-2">Phone (Optional)</label>
          <input type="tel" name="phone" value={formData.phone} onChange={handleChange} className="input" />
        </div>

        <div className="mb-6">
          <label className="block text-sm font-medium mb-2">Password</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            className="input"
            required
            minLength="6"
          />
          <p className="text-xs text-muted mt-1">Must be at least 6 characters</p>
        </div>

        <button type="submit" className="btn btn-primary w-full mb-4" disabled={loading}>
          {loading ? "Creating account..." : "Create Account"}
        </button>
      </form>

      <div className="text-center">
        <p className="text-sm text-muted">
          Already have an account?{" "}
          <Link to="/login" className="underline" style={{ color: "var(--foreground)" }}>
            Sign in
          </Link>
        </p>
      </div>
    </div>
  </div>
</div>

  )
}

export default RegisterPage
